-- ----------------------------
-- Table structure for `syncer_employee`
-- ----------------------------
DROP TABLE IF EXISTS `syncer_employee`;
CREATE TABLE `syncer_employee` (
  `id` int(10) unsigned NOT NULL auto_increment COMMENT '流水号',
  `user_no` varchar(64) NOT NULL COMMENT '员工号',
  `username` varchar(128) NOT NULL COMMENT '用户真实姓名',
  `email` varchar(64) NOT NULL COMMENT '用户邮箱',
  `mobile` varchar(32) NOT NULL COMMENT '用户手机号',
  `gender` varchar(8) NOT NULL COMMENT '性别  男，女',
  `post_title` varchar(128) default NULL COMMENT '职务名称',
  `department` varchar(128) NOT NULL COMMENT '部门',
  `post_type` varchar(128) NOT NULL COMMENT '岗位分类',
  `staff_type` varchar(128) NOT NULL COMMENT '编制类型',
  `post_level` varchar(128) NOT NULL COMMENT '行政职务等级',
  `teach_flag` varchar(8) NOT NULL default '是' COMMENT '是否任课  是，否',
  `retire_flag` varchar(8) NOT NULL default '否' COMMENT '是否退休  否，是',
  `cert_flag` varchar(8) NOT NULL default '否' COMMENT '是否具备教师资格  否，是',
  `status` varchar(8) NOT NULL default '可用' COMMENT '状态  不可用，可用',
  `last_modify_user_id` int(11) NOT NULL COMMENT '最后修改人',
  `create_date` datetime NOT NULL COMMENT '创建日期',
  `modify_date` datetime NOT NULL COMMENT '修改日期',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=251 DEFAULT CHARSET=utf8 COMMENT='教职工数据同步表';

