DROP TABLE IF EXISTS `edu_tch_employee`;
CREATE TABLE `edu_tch_employee` (
  `user_id` int(11) NOT NULL COMMENT '用户表流水号',
  `pinyin` varchar(512) default NULL COMMENT '拼音',
  `jianpin` varchar(128) default NULL COMMENT '简拼',
  `gender` int(11) NOT NULL COMMENT '性别',
  `post_title` varchar(128) default NULL COMMENT '职务名称',
  `department_id` int(11) NOT NULL COMMENT '部门',
  `post_type_id` int(11) NOT NULL COMMENT '岗位分类',
  `staff_type_id` int(11) NOT NULL COMMENT '编制类型',
  `post_level_id` int(11) NOT NULL COMMENT '行政职务等级',
  `teach_flag` int(11) NOT NULL default '1' COMMENT '是否任课',
  `retire_flag` int(11) NOT NULL default '0' COMMENT '是否退休',
  `cert_flag` int(11) NOT NULL default '0' COMMENT '是否具备教师资格',
  `status` int(11) NOT NULL default '1' COMMENT '状态',
  `last_modify_user_id` int(11) NOT NULL COMMENT '最后修改人',
  `create_date` datetime NOT NULL COMMENT '创建日期',
  `modify_date` datetime NOT NULL COMMENT '修改日期',
  `logic_delete` int(11) NOT NULL default '0' COMMENT '逻辑删除',
  PRIMARY KEY  (`user_id`),
  KEY `fk_edu_tch_employee_department_id` (`department_id`),
  KEY `fk_edu_tch_employee_post_type_id` (`post_type_id`),
  KEY `fk_edu_tch_employee_staff_type_id` (`staff_type_id`),
  KEY `fk_edu_tch_employee_post_level_id` (`post_level_id`),
  KEY `fk_edu_tch_employee_last_modify_user_id` (`last_modify_user_id`),
  CONSTRAINT `fk_edu_tch_employee_department_id` FOREIGN KEY (`department_id`) REFERENCES `dict_edu_common_department` (`id`),
  CONSTRAINT `fk_edu_tch_employee_last_modify_user_id` FOREIGN KEY (`last_modify_user_id`) REFERENCES `sys_user` (`id`),
  CONSTRAINT `fk_edu_tch_employee_post_level_id` FOREIGN KEY (`post_level_id`) REFERENCES `dict_edu_tch_post_level` (`id`),
  CONSTRAINT `fk_edu_tch_employee_post_type_id` FOREIGN KEY (`post_type_id`) REFERENCES `dict_edu_tch_post_type` (`id`),
  CONSTRAINT `fk_edu_tch_employee_staff_type_id` FOREIGN KEY (`staff_type_id`) REFERENCES `dict_edu_tch_staff_type` (`id`),
  CONSTRAINT `fk_edu_tch_employee_user_id` FOREIGN KEY (`user_id`) REFERENCES `sys_user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='[教务]教职工表';

