-- ----------------------------
-- Table structure for `sys_user`
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` int(11) NOT NULL auto_increment COMMENT '流水号',
  `user_no` varchar(32) default NULL COMMENT '员工号',
  `username` varchar(128) NOT NULL COMMENT '用户真实姓名',
  `password` varchar(128) default NULL COMMENT '用户密码',
  `salt` varchar(32) default NULL COMMENT '盐',
  `email` varchar(64) default NULL COMMENT '用户邮箱',
  `mobile` varchar(32) default NULL COMMENT '用户手机号',
  `session_id` varchar(64) default NULL COMMENT '会话标识',
  `token` varchar(64) default NULL COMMENT '令牌',
  `last_modify_user_id` int(11) default NULL COMMENT '最后修改人',
  `create_date` datetime default NULL COMMENT '创建日期',
  `modify_date` datetime default NULL COMMENT '修改日期',
  `status` int(11) NOT NULL default '1' COMMENT '状态',
  `locked` int(11) NOT NULL default '0' COMMENT '锁定状态',
  `logic_delete` int(11) default '0' COMMENT '逻辑删除',
  `user_role` int(11) NOT NULL default '0' COMMENT '用户角色',
  PRIMARY KEY  (`id`),
  UNIQUE KEY `idx_sys_user_user_no` (`user_no`),
  KEY `fk_sys_user_last_modify_user_id` (`last_modify_user_id`),
  CONSTRAINT `fk_sys_user_last_modify_user_id` FOREIGN KEY (`last_modify_user_id`) REFERENCES `sys_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11147 DEFAULT CHARSET=utf8 COMMENT='[系统]用户表';

